import React, { useState, useEffect, useRef } from "react";
import { companyChatService } from "../services/api";

const CompanyChat = ({ companyId }) => {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState("");
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const messagesEndRef = useRef(null);

  // تمرير الـ Scroll تلقائي
  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  useEffect(() => {
    if (!companyId) {
      setError("Company ID is missing.");
      setLoading(false);
      return;
    }

    const fetchMessages = async () => {
      try {
        const res = await companyChatService.getMessages(companyId);
        setMessages(res);
      } catch (err) {
        console.error("Error fetching messages:", err);
        setError("Failed to load messages.");
      } finally {
        setLoading(false);
      }
    };

    fetchMessages();
  }, [companyId]);

  useEffect(scrollToBottom, [messages]);

  const sendMessage = async () => {
    if (!companyId) return;
    if (!input.trim()) return;

    const text = input.trim();
    setMessages(prev => [...prev, { user: "me", text }]);
    setInput("");

    try {
      const res = await companyChatService.sendAiMessage(companyId, text);
      setMessages(prev => [...prev, res]);
    } catch (err) {
      console.error(err);
      setMessages(prev => [...prev, { user: "AI", text: "Error contacting AI" }]);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === "Enter") sendMessage();
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.header}>Company Chat</h2>
      {loading && <p style={styles.loading}>Loading messages...</p>}
      {error && <p style={styles.error}>{error}</p>}

      <div style={styles.chatBox}>
        {messages.map((m, i) => (
          <div
            key={i}
            style={m.user === "me" ? styles.userMessage : styles.aiMessage}
          >
            <strong>{m.user === "me" ? "You" : "AI"}:</strong> {m.text}
          </div>
        ))}
        <div ref={messagesEndRef} />
      </div>

      <div style={styles.inputContainer}>
        <input
          style={styles.input}
          value={input}
          onChange={e => setInput(e.target.value)}
          onKeyPress={handleKeyPress}
          placeholder="Type your message..."
        />
        <button style={styles.button} onClick={sendMessage}>
          Send
        </button>
      </div>
    </div>
  );
};

const styles = {
  container: {
    width: "400px",
    maxWidth: "90%",
    margin: "50px auto",
    padding: "20px",
    borderRadius: "10px",
    backgroundColor: "#f5f5f5",
    boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
    fontFamily: "Arial, sans-serif",
  },
  header: {
    textAlign: "center",
    marginBottom: "15px",
    color: "#333",
  },
  loading: {
    textAlign: "center",
    color: "#666",
  },
  error: {
    textAlign: "center",
    color: "red",
  },
  chatBox: {
    height: "300px",
    overflowY: "auto",
    padding: "10px",
    border: "1px solid #ddd",
    borderRadius: "8px",
    marginBottom: "10px",
    backgroundColor: "#fff",
  },
  userMessage: {
    backgroundColor: "#d1e7dd",
    padding: "8px 12px",
    borderRadius: "15px",
    margin: "5px 0",
    alignSelf: "flex-end",
    maxWidth: "80%",
  },
  aiMessage: {
    backgroundColor: "#f8d7da",
    padding: "8px 12px",
    borderRadius: "15px",
    margin: "5px 0",
    alignSelf: "flex-start",
    maxWidth: "80%",
  },
  inputContainer: {
    display: "flex",
    gap: "10px",
  },
  input: {
    flex: 1,
    padding: "10px",
    borderRadius: "8px",
    border: "1px solid #ccc",
    outline: "none",
  },
  button: {
    padding: "10px 15px",
    borderRadius: "8px",
    border: "none",
    backgroundColor: "#0d6efd",
    color: "#fff",
    cursor: "pointer",
  },
};

export default CompanyChat;
